import React, { Component } from 'react';
export default class About extends Component {
  render() {
    let resumeData = this.props.resumeData;
    return (
      <section id="about">
         <div className="row">



            <div className="nine columns main-col">

               <h2>About Me</h2>
               <p>
               {
                 resumeData.aboutme
               }
               </p>

               <div className="row">

                  <div className="columns contact-details">


                  <p className="address">
                     <br></br>
       						   <span></span>
                    <br></br>
                    <span></span>
       					    </p>
                   </div>
               </div>
            </div>
         </div>
      </section>
    );
  }
}
